BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "django_migrations" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app" varchar(255) NOT NULL, "name" varchar(255) NOT NULL, "applied" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "auth_user_groups" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "auth_user_user_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "django_admin_log" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "object_id" text NULL, "object_repr" varchar(200) NOT NULL, "action_flag" smallint unsigned NOT NULL CHECK ("action_flag" >= 0), "change_message" text NOT NULL, "content_type_id" integer NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "action_time" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "arbeitszeit_arbeitszeithistorie" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "aenderung_am" datetime NOT NULL, "alter_status" varchar(20) NOT NULL, "neuer_status" varchar(20) NOT NULL, "bemerkung" text NOT NULL, "aenderung_durch_id" integer NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "vereinbarung_id" bigint NOT NULL REFERENCES "arbeitszeit_arbeitszeitvereinbarung" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "arbeitszeit_arbeitszeitvereinbarung" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "antragsart" varchar(20) NOT NULL, "arbeitszeit_typ" varchar(20) NOT NULL, "wochenstunden" decimal NULL, "gueltig_ab" date NOT NULL, "gueltig_bis" date NULL, "telearbeit" bool NOT NULL, "status" varchar(20) NOT NULL, "genehmigt_am" datetime NULL, "beendigung_beantragt" bool NOT NULL, "beendigung_datum" date NULL, "bemerkungen" text NOT NULL, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "genehmigt_von_id" integer NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "mitarbeiter_id" bigint NOT NULL REFERENCES "arbeitszeit_mitarbeiter" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "arbeitszeit_urlaubsanspruch" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "jahr" integer NOT NULL, "jahresurlaubstage_vollzeit" decimal NOT NULL, "jahresurlaubstage_anteilig" decimal NOT NULL, "genommene_urlaubstage" decimal NOT NULL, "mitarbeiter_id" bigint NOT NULL REFERENCES "arbeitszeit_mitarbeiter" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "arbeitszeit_zeiterfassung" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "datum" date NOT NULL, "arbeitsbeginn" time NULL, "arbeitsende" time NULL, "pause_minuten" integer NOT NULL, "arbeitszeit_minuten" integer NULL, "art" varchar(20) NOT NULL, "bemerkung" text NOT NULL, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "mitarbeiter_id" bigint NOT NULL REFERENCES "arbeitszeit_mitarbeiter" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "django_content_type" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app_label" varchar(100) NOT NULL, "model" varchar(100) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_permission" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "content_type_id" integer NOT NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "codename" varchar(100) NOT NULL, "name" varchar(255) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(150) NOT NULL UNIQUE);
CREATE TABLE IF NOT EXISTS "auth_user" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "password" varchar(128) NOT NULL, "last_login" datetime NULL, "is_superuser" bool NOT NULL, "username" varchar(150) NOT NULL UNIQUE, "last_name" varchar(150) NOT NULL, "email" varchar(254) NOT NULL, "is_staff" bool NOT NULL, "is_active" bool NOT NULL, "date_joined" datetime NOT NULL, "first_name" varchar(150) NOT NULL);
CREATE TABLE IF NOT EXISTS "django_session" ("session_key" varchar(40) NOT NULL PRIMARY KEY, "session_data" text NOT NULL, "expire_date" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "schichtplan_schicht" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "datum" date NOT NULL, "abweichende_start_zeit" time NULL, "abweichende_ende_zeit" time NULL, "bemerkungen" text NOT NULL, "mitarbeiter_id" bigint NOT NULL REFERENCES "arbeitszeit_mitarbeiter" ("id") DEFERRABLE INITIALLY DEFERRED, "schichtplan_id" bigint NOT NULL REFERENCES "schichtplan_schichtplan" ("id") DEFERRABLE INITIALLY DEFERRED, "schichttyp_id" bigint NOT NULL REFERENCES "schichtplan_schichttyp" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "schichtplan_schichttausch" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "status" varchar(20) NOT NULL, "nachricht" text NOT NULL, "erstellt_am" datetime NOT NULL, "angeboten_von_id" bigint NOT NULL REFERENCES "arbeitszeit_mitarbeiter" ("id") DEFERRABLE INITIALLY DEFERRED, "gewuenschter_partner_id" bigint NULL REFERENCES "arbeitszeit_mitarbeiter" ("id") DEFERRABLE INITIALLY DEFERRED, "urspruengliche_schicht_id" bigint NOT NULL REFERENCES "schichtplan_schicht" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "schichtplan_schichtwunsch" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "datum" date NOT NULL, "erstellt_am" datetime NOT NULL, "mitarbeiter_id" bigint NOT NULL REFERENCES "arbeitszeit_mitarbeiter" ("id") DEFERRABLE INITIALLY DEFERRED, "begruendung" text NOT NULL, "benoetigt_genehmigung" bool NOT NULL, "genehmigt" bool NOT NULL, "genehmigt_am" datetime NULL, "genehmigt_von_id" integer NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "wunsch" varchar(30) NOT NULL, "periode_id" bigint NULL REFERENCES "schichtplan_schichtwunschperiode" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "schichtplan_schichtplan" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "start_datum" date NOT NULL, "ende_datum" date NOT NULL, "erstellt_am" datetime NOT NULL, "aktualisiert_am" datetime NOT NULL, "status" varchar(20) NOT NULL, "bemerkungen" text NOT NULL, "erstellt_von_id" integer NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "name" varchar(200) NOT NULL, "wunschperiode_id" bigint NULL REFERENCES "schichtplan_schichtwunschperiode" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "schichtplan_schichttyp" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(100) NOT NULL, "kuerzel" varchar(10) NOT NULL, "start_zeit" time NOT NULL, "ende_zeit" time NOT NULL, "farbe" varchar(7) NOT NULL, "aktiv" bool NOT NULL, "pausenzeit_minuten" integer NOT NULL);
CREATE TABLE IF NOT EXISTS "schichtplan_schichtwunschperiode" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(100) NOT NULL, "fuer_monat" date NOT NULL, "eingabe_start" datetime NOT NULL, "eingabe_ende" datetime NOT NULL, "status" varchar(20) NOT NULL, "erstellt_am" datetime NOT NULL, "aktualisiert_am" datetime NOT NULL, "erstellt_von_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "arbeitszeit_tagesarbeitszeit" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "zeitwert" integer NOT NULL, "vereinbarung_id" bigint NOT NULL REFERENCES "arbeitszeit_arbeitszeitvereinbarung" ("id") DEFERRABLE INITIALLY DEFERRED, "woche" integer NOT NULL, "wochentag" varchar(10) NOT NULL);
CREATE TABLE IF NOT EXISTS "arbeitszeit_monatlichearbeitszeitsoll" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "jahr" integer NOT NULL, "monat" integer NOT NULL, "arbeitstage_gesamt" integer NOT NULL, "feiertage_anzahl" integer NOT NULL, "arbeitstage_effektiv" integer NOT NULL, "wochenstunden" decimal NOT NULL, "soll_stunden" decimal NOT NULL, "feiertage_liste" text NOT NULL CHECK ((JSON_VALID("feiertage_liste") OR "feiertage_liste" IS NULL)), "berechnet_am" datetime NOT NULL, "mitarbeiter_id" bigint NOT NULL REFERENCES "arbeitszeit_mitarbeiter" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "arbeitszeit_mitarbeiter" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "personalnummer" varchar(20) NOT NULL UNIQUE, "nachname" varchar(100) NOT NULL, "vorname" varchar(100) NOT NULL, "abteilung" varchar(100) NOT NULL, "standort" varchar(20) NOT NULL, "eintrittsdatum" date NULL, "aktiv" bool NOT NULL, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "user_id" integer NOT NULL UNIQUE REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "rolle" varchar(20) NOT NULL, "arbeitszeit_typ" varchar(20) NOT NULL, "kann_nachtschicht" bool NOT NULL, "kann_tagschicht" bool NOT NULL, "max_aufeinanderfolgende_tage" integer NOT NULL, "max_schichten_pro_monat" integer NULL, "max_wochenenden_pro_monat" integer NOT NULL, "nachtschicht_nur_wochenende" bool NOT NULL, "nur_zusatzarbeiten" bool NOT NULL, "planungs_prioritaet" varchar(10) NOT NULL, "schichtplan_bemerkungen" text NOT NULL, "schichtplan_kennung" varchar(10) NOT NULL, "verfuegbarkeit" varchar(20) NOT NULL, "nur_zusatzdienste_wochentags" bool NOT NULL, "schichtplan_einschraenkungen" text NOT NULL, "schicht_typ" varchar(10) NOT NULL, "erlaubte_wochentage" text NULL CHECK ((JSON_VALID("erlaubte_wochentage") OR "erlaubte_wochentage" IS NULL)), "keine_zusatzdienste" bool NOT NULL, "fixe_tag_wochentage" text NULL CHECK ((JSON_VALID("fixe_tag_wochentage") OR "fixe_tag_wochentage" IS NULL)), "kategorie" varchar(20) NOT NULL, "min_nachtschichten_pro_monat" integer NULL, "min_tagschichten_pro_monat" integer NULL, "target_nachtschichten_pro_monat" integer NULL, "target_tagschichten_pro_monat" integer NULL, "wochenend_nachtdienst_block" bool NOT NULL, "zaehlt_zur_nachtbesetzung" bool NOT NULL, "zaehlt_zur_tagbesetzung" bool NOT NULL);
CREATE TABLE IF NOT EXISTS "schichtplan_schichtplanaenderung" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "zeit" datetime NOT NULL, "aktion" varchar(20) NOT NULL, "beschreibung" varchar(400) NOT NULL, "undo_daten" text NOT NULL CHECK ((JSON_VALID("undo_daten") OR "undo_daten" IS NULL)), "zurueckgenommen" bool NOT NULL, "schichtplan_id" bigint NOT NULL REFERENCES "schichtplan_schichtplan" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" integer NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED);
PRAGMA writable_schema=ON;
